.nav-equipo {
    display: flex;
    justify-content: space-evenly;
    margin-top: 2rem;
}

@media (min-width: 768px) {
    .nav-equipo {
        margin-top: 0;
    }
}

.nav-equipo a:hover {
    color: var(--color-fondo);
}

.equipo-detalle {
    display: grid;
    grid-template-columns: repeat(1, 1fr);
    grid-gap: 2rem;
    align-items: center;
    justify-items: center;
}

@media (min-width: 768px) {
    .equipo-detalle {
        grid-template-columns: repeat(2, 1fr);
    }
}

.equipo-detalle img {
    max-width: 25rem;
}

.imagen-equipo {
    display: grid;
    align-items: center;
    justify-items: center;
}

.imagenes-detalle {
    height: 10rem;
    display: flex;
    align-items: center;
    justify-content: center;
    margin-bottom: 2rem;
}

.imagen-detalle {
    max-height: 100%;
}


/* PÁGINA FAQS */

.faqs h2 {
    text-align: left;
    margin: 2rem 0 1rem 0;
}

#countdown {
    display: flex;
    align-items: center;
    justify-content: center;
    height: 1.7rem;
    font-size: 1.7rem;
    color: var(--color-fondo);
    margin-bottom: 4rem;
}

@media (min-width: 768px) {
    #countdown {
        height: 3rem;
        font-size: 3rem;
    }
}

.cuenta-atras {
    margin-top: 3rem;
    padding-bottom: 3rem;
}


/* PÁGINA DESCARGAR */


/* clases rotar y zoom */

.rotar {
    animation-duration: 3s;
    animation-fill-mode: forwards;
    animation-name: rotar;
}

@keyframes rotar {
    from {
        transform: rotate(0) scale(1);
    }
    to {
        transform: rotate(-40deg) scale(1.5);
    }
}

.imagen-descargar {
    width: 40rem;
}
